webpackJsonp([0xaf31198c508a],{890:function(e,n){e.exports={data:{contentfulBlogPost:{title:"[codewars] String Reordering",id:"c7yuyCA8spyQ6Q2UO2gSQ0w",publishDate:"May 29th, 2018",heroImage:{file:{url:"//images.ctfassets.net/hu4faubeotg0/6hBUhX5xKgUs0WAGGQOK8k/9b9aed31763f88e8668bb1a6a9e69236/codewars.jpg"}},body:{childMarkdownRemark:{html:"<p>The input will be an array of dictionaries.</p>\n<p>Return the values as a string-seperated sentence in the order of their keys' integer equivalent (increasing order).</p>\n<p>The keys are not reoccurring and their range is -999 &#x3C; key &#x3C; 999. The dictionaries' keys &#x26; values will always be strings and will always not be empty.</p>\n<p>Example</p>\n<pre><code>Input:\nList = [\n        {'4': 'dog' }, {'2': 'took'}, {'3': 'his'},\n        {'-2': 'Vatsan'}, {'5': 'for'}, {'6': 'a'}, {'12': 'spin'}\n       ]\n\nOutput:\n'Vatsan took his dog for a spin'\n</code></pre>\n<p>My Answer</p>\n<pre><code>function sentence(List) {\n  return List.sort((curr, next) => Object.keys(curr)[0] - Object.keys(next)[0]).map(item => item[Object.keys(item)[0]]).join(' ');\n}\n</code></pre>"}}}},pathContext:{slug:"codewars-string-reordering"}}}});
